    //             //10
    //             point += 10;
    //         else point += ((Hand[i] % 13) + 1); //+
    //     }
    //     while (
    //         point > 21 //21A1
    //     ) {
    //         if (A > 0) {
    //             A--;
    //             point -= 10;
    //         }
    //     }
    //     if (point > 21) return 0;
    //     return point;
    // }
}

